import Link from 'next/link';
import injectSheet from 'react-jss'

const styles =  {    
  logo: {
    width: '100%',
    textAlign: 'center',
    marginTop: '1rem',
    '& img':{
      position: 'relative',
      width: '100%'
    }
  } 
}

const Header = () => (
<div>
  <div className="logo">
    <Link href="/">
      <img src="/img/logo.png"/>
    </Link>
  </div>
  <Link href="/" >
    <a>Next</a>
  </Link>
  <Link href="/" >
    <a>Previous</a>
  </Link>
  <Link href="/" >
    <a>Random</a>
  </Link>
</div>
);

export default injectSheet(styles)(Header);
